comment_text:
@Ella-Bella2024  I don't think YOU are ignorant ma'am, however the statement and the response are very "This is how I see it, and nothing anyone say's will change my opinion on this".  I agree that people who don't want children should not have them, but that is just not the reality or world that we do or ever will live in. many men and women have sex  for pleasure and not procreation, the act sometimes results in unwanted pregnancies, and for whatever reason, whether it be religious, or family pressure, or guilt, or laws stopping the mother from aborting the unwanted child,  tens of millions of children are  born every year unwanted. Some parents rise to the occasion and find it in their hearts to love and care for  their "surprise" children, but that's just not that case for a large number of people across the globe. In many cases, the "parents" keep the life before the child, they focus on work, their social life, drugs, alcohol, whatever they had before and neglect the needs of the child sometimes leaving them in abusive homes until CPS  comes to take them from these toxic/abusive homes, but then they end up in foster care which is not always much better for them. 

I do agree that society does not understand the importance of raising and being involved in the childrens lives but I also think that the economic structure than many live in today simply doesn't allow parents to be parents unless they are some sort of "super mom/dad" who can manage those 40-80 hr work weeks just to put food on the table and a roof over their heads and still are able to force themselves to be actively involved in the childs lives even when they are physically and emotionally drained. I think that having an aide (human or synthetic) for these parents who don't have to energy to be parents, to aide in everyday time consuming hassles, preparing meals, doing dishes, laundry, cleaning the house, all those hours of mundane tasks we have to do on a daily basis, can be converted to 1 on 1 time with their children strengthening bonds. now i don't think the robots should be doing everything in the house forever. but those initial years of the childs life would be important in providing the parents with more bonding time and less time dealing with the chores of life. Ideally for me once the kids are of age to start learning everyday life skills that would be the time for the synthetic nanny to be less involved and have the parent teach those skills (have the kids learn to make meals, clean up the house, make their beds etc).

 I don't disagree with your ideal world but I just find it a bit closeminded to completely discredit a hypothetical and very realistic future that SOME (not all) future parents may want to entertain. I don't think any Rational person is asking for robots to completely replace parents. That is definitely not what I am hearing from this gentleman at the very least.
